    false,nt"url": null,nt"notes": "The United States Fish and Wildlife Service
    (USFWS) contracted with Phillip A. Townsend to determine and map the plant communities
    within the Roanoke River National Wildlife Refuge, in coastal North Carolina.  The
    vegetation map was created by Townsend using a combination of aerial photo interpretation
    and on-the-ground field assessment.  The goal of the project was to classify the
    vegetation communities in the NWR using the National Vegetation Classification Standard
    (USNVC) and map to the USNVCS association level wherever possible.  This geodatabase
    contains the GIS data associated with that work.",nt"license_title": "License
